DROP TABLE IF EXISTS [CountyPrepData];
CREATE TABLE [CountyPrepData](
GEOID INTEGER,
County VARCHAR (50),
State VARCHAR (10),
Year INTEGER,
CountyUsers INTEGER,
MaleUsers VARCHAR(5),
FemaleUsers VARCHAR(5),
PRIMARY KEY (GEOID,Year));

;


DROP TABLE IF EXISTS Populations;
CREATE TABLE Populations(
GEOID INTEGER,
County VARCHAR (50),
State VARCHAR (10),
Year INTEGER,
BothGendersPopulation INTEGER,
FemalePopulation INTEGER,
MalePopulation INTEGER,
PRIMARY KEY (GEOID,Year));

;


DROP TABLE IF EXISTS  diagnosesofHIV;																				
CREATE TABLE diagnosesofHIV (																				
    GEOID INTEGER,																				
    Year INTEGER,																				
    County VARCHAR(20),																				
    CaseCount INTEGER,																				
    PRIMARY KEY (GEOID, YEAR)																				
);																				
;
																				

DROP TABLE IF EXISTS  [MedianHouseHoldIncome];																				
CREATE TABLE  [MedianHouseHoldIncome] (																				
    GEOID INTEGER,																				
    Year INTEGER,																				
    County VARCHAR(20),																				
    HouseHoldIncome INTEGER,																				
    PRIMARY KEY (GEOID, Year)																				
);																				
																			
;


DROP TABLE IF EXISTS DiagnosesOfGender;
CREATE TABLE DiagnosesOfGender(
GEOID INTEGER,
Year INTEGER,
State VARCHAR (10),
County VARCHAR (50),
NewDiagnosesMale INTEGER,
NewDiagnosesFemale INTEGER,
PRIMARY KEY (GEOID,Year));
;


DROP TABLE IF EXISTS RateofUnemployment;
CREATE TABLE RateofUnemployment(
GEOID INTEGER,
County VARCHAR (50),
State VARCHAR (10),
Year INTEGER,
UnemploymentRates INTEGER,
PRIMARY KEY (GEOID,Year));

;

DROP TABLE IF EXISTS  SmallDataWarehouse;
Create Table SmallDataWarehouse as 
SELECT DIAGNOSESOFHIV.*,Populations.State,
 [CountyPrepData].COUNTYUSERS, [CountyPrepData].MALEUSERS, [CountyPrepData].FEMALEUSERS, Populations.BothGendersPopulation, 
Populations.MalePopulation, Populations.FemalePopulation, [Medianhouseholdincome].HouseHoldIncome, RateofUnemployment.UnemploymentRates, DiagnosesOfGender.NewDiagnosesMale, 
DiagnosesOfGender.NewDiagnosesFemale
FROM DIAGNOSESOFHIV
			LEFT JOIN [CountyPrepData] on DIAGNOSESOFHIV.GEOID = [CountyPrepData].GEOID AND DIAGNOSESOFHIV.Year = [CountyPrepData].Year
			LEFT JOIN Populations on DIAGNOSESOFHIV.GEOID = Populations.GEOID AND DIAGNOSESOFHIV.Year = Populations.Year
			LEFT JOIN [Medianhouseholdincome] on DIAGNOSESOFHIV.GEOID = [Medianhouseholdincome].GEOID AND DIAGNOSESOFHIV.Year = [Medianhouseholdincome].Year
			LEFT JOIN RateofUnemployment ON DIAGNOSESOFHIV.GEOID = RateofUnemployment.GEOID AND DIAGNOSESOFHIV.Year = RateofUnemployment.Year
			LEFT JOIN DiagnosesOfGender ON DIAGNOSESOFHIV.GEOID = DiagnosesOfGender.GEOID AND DIAGNOSESOFHIV.Year = DiagnosesOfGender.Year;

			
DROP TABLE if EXISTS CasebyPopulationPCT;
CREATE table CaseByPopulationPCT as
SELECT GEOID,Year, round(100.00*NewDiagnosesMale/MalePopulation,4) as MaleCasesbyPopulationPCT, round(100.00*NewDiagnosesFemale/FemalePopulation,4) as FemaleCasesByPopulationPCT, round(100.00* CaseCount/BothGendersPopulation,4)
as CasesByPopulationPCT
FROM SmallDataWarehouse;


Drop table if exists PrepUsersByCasesPCT;
CREATE TABLE PrepUsersByCasesPCT as
SELECT GEOID,Year, ROUND(100.0* CountyUsers/CaseCount,1) as PrepByCasesPCT,ROUND(100.00* MaleUsers/NewDiagnosesMale,1) As MalePrepbyCasesPCT, ROUND(100.0*FemaleUsers/NewDiagnosesFemale,1) as FemalePrepByCasesPCT
FROM SmallDataWarehouse;

DROP TABLE if EXISTS PrepUsersByPopPCT;
CREATE TABLE PrepUsersByPopPCT as
SELECT GEOID,Year,ROUND(100.0* CountyUsers/BothGendersPopulation,4) as UsersbyPopPCT, ROUND(100.00*MaleUsers/MalePopulation,4) as MaleUsersbyPopPCT, ROUND(100.00* FemaleUsers/FemalePopulation,4) as FemaleUsersbyPopPCT
FROM SmallDataWarehouse;

DROP TABLE IF EXISTS  WarehouseData;
Create Table WarehouseData as
Select  SmallDataWarehouse.*, CasebyPopulationPCT.MaleCasesbyPopulationPCT, CasebyPopulationPCT.CasesByPopulationPCT,CasebyPopulationPCT.FemaleCasesByPopulationPCT, PrepUsersByCasesPCT.PrepByCasesPCT, PrepUsersByCasesPCT.MalePrepbyCasesPCT,
PrepUsersByCasesPCT.FemalePrepByCasesPCT,PrepUsersByPopPCT.UsersbyPopPCT, PrepUsersByPopPCT.MaleUsersbyPopPCT,PrepUsersByPopPCT.FemaleUsersbyPopPCT
FROM SmallDataWarehouse

LEFT JOIN CasebyPopulationPCT on SmallDataWarehouse.GEOID=CasebyPopulationPCT.GEOID  AND  SmallDataWarehouse.Year=CasebyPopulationPCT.Year
LEFT JOIN PrepUsersByPopPCT on SmallDataWarehouse.GEOID=PrepUsersByPopPCT.GEOID and SmallDataWarehouse.Year=PrepUsersByPopPCT.Year
LEFT JOIN PrepUsersByCasesPCT on SmallDataWarehouse.GEOID=PrepUsersByCasesPCT.GEOID  AND SmallDataWarehouse.Year=PrepUsersByCasesPCT.Year;
